import React from "react";
import "../App.css";
import "./css/BlackButton.css";

export const RoundedButton = ({ children, type, onClick, href }) => {
  return (
    <button class="template" onClick={onClick} type={type} href={href}>
      {children}
    </button>
  );
};

export default RoundedButton;
